import React from 'react'
import { createContext, useReducer } from 'react'
export const ProductsContext = createContext()

export const ProductsContextProvider = ({ children }) => {
  const productsData = [{ img: 'Product_10_Lulu_Student.webp', name: 'Lulu Student' }, { img: 'Product_11_fitness_Lulu.jpg', name: 'Fitness Lulu' }, { img: 'Product_1_Wukong.webp', name: 'Wukong' }, { img: 'Product_2_flamingo_floatie.jpg', name: 'Flamingo Floatie' }, { img: 'Product_3_Birthday_Cake.jpg', name: 'Birthday Cake' }, { img: 'Product_4_Can_of_3.jpg', name: 'Can of Three' }, { img: 'Product_5_Party_Lulu.jpg', name: 'Party Lulu' }, { img: 'Product_6_Can_Of_6.jpg', name: 'Can of Six' }, { img: 'Product_7_Lulu_Sheep.jpg', name: 'Lulu Sheep' }, { img: 'Product_8_Lulu_Lite.jpg', name: 'Lulu Lite' }, { img: 'Product_9_Sakura_Lulu.jpg', name: 'Sakura Lulu' }]
  return (

    <ProductsContext.Provider value={{productsData}}>
      {children}
    </ProductsContext.Provider>
  )
}
